    return (
        <div className= {styles.input}>
       <input type="text" placeholder="'type somthing..."/>
       <div className={styles.send}>
        <img src="" alt=""/>
        <input type="file" style={{display:"none"}} id="file"/>
        <label htmlFor="fiile">
            <img src= {attach} alt=""/>

        </label>
        <button>Send</button>
       </div>
        </div>
    )
}
export default Input;
